"""# Validação dos modelos

# Matriz de confusão

![image.png](data:image/png;base64,)

Primeira coluna, temos o "SIM". Segunda coluna, o "NÃO". Primeira linha, "SIM", segunda linha, "NÃO". As colunas representam os resultados preditos e as linhas representam os valores reais, aqueles que realmente são. Como funciona a matriz de confusão, quais são as visões que ela traz? Ela traz os nossos resultados.

Vamos começar aqui na primeira coluna e na primeira linha. Temos o "SIM", foi predito um valor "SIM" e o valor real realmente era "SIM". Qual é o resultado disso? É um verdadeiro positivo, é um verdadeiro sim. Temos o Churn, a Maria foi classificada como "SIM". Estava lá que realmente é um "SIM". Esse é o verdadeiro positivo, são os resultados verdadeiramente corretos, como "SIM". Agora vamos para a segunda visão dos nossos resultados.

 Vamos para a segunda coluna, primeira linha. Temos o predito como o valor "NÃO", porém, o real é o "SIM". Esse resultado é conhecido como falso negativo ou um falso não, ele deveria ser predito como "SIM", mas ele foi predito como "NÃO". É um valor incorreto da nossa classificação, são aqueles resultados errôneos. Agora podemos passar para a segunda linha. Vamos lá. Primeira coluna, segunda linha. Foi um predito que o valor é um "SIM", contudo, o verdadeiro valor é um "NÃO".

O que isso quer dizer? Isso quer dizer que o Churn foi previsto como "SIM", só que o valor dele real é "NÃO". Temos um resultado falso positivo, ou seja, um falso sim, aquele Churn que foi visto como "SIM", mas, na verdade, ele é um "NÃO". São os resultados também errados, são os resultados errôneos da nossa classificação. Agora segunda coluna, segunda linha. Temos o predito como "NÃO" e o real como "NÃO".

São aqueles valores que são os verdadeiros negativos, são os valores realmente preditos com "NÃO" e são realmente "NÃO". Foi um Churn previsto como "NÃO" e ele realmente é um "NÃO". Outro valor previsto de forma correta. Nossos valores verdadeiros, positivo e verdadeiro negativo são os valores previstos de forma correta no nosso modelo. Agora entendemos como que é estruturada a matriz de confusão, como ela funciona.
"""

from sklearn.metrics import confusion_matrix

print(confusion_matrix(y_teste, predito_knn))

print(confusion_matrix(y_teste, predito_BNb))

print(confusion_matrix(y_teste, predito_ArvoreDecisao))

"""#  Acurácia

A partir do calculo da matriz de confusão conseguimos inferir outras métricas, como por exemplo a acurária.

 ![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)
"""

from sklearn.metrics import accuracy_score

#modelo KNN
print(accuracy_score(y_teste, predito_knn))

#modelo Bernoulli de naive bayes
print(accuracy_score(y_teste, predito_BNb))

#modelo árvore de decisão
print(accuracy_score(y_teste, predito_ArvoreDecisao))

"""# Precisão

Outra métrica importante é a precisão, que calcula quantos foram classificados corretamento como positivos (TP).

![image.png](data:image/png;base64,)

Sabemos que os verdadeiros positivos são aqueles que foram realmente preditos como verdadeiro sim, a precisão é calculada da seguinte forma: o total de verdadeiros positivos dividido pelos verdadeiros positivos mais os falsos positivos, "PS = TP/TP + FP"
"""

from sklearn.metrics import precision_score

#modelo KNN
print(precision_score(y_teste, predito_knn))

#modelo Bernoulli de naive bayes
print(precision_score(y_teste, predito_BNb))

#modelo árvore de decisão
print(precision_score(y_teste, predito_ArvoreDecisao))

"""# Recall

Outra métrica importante é a Recall ou revocação ou ainda sensibilidade, que calcula o quão bom o modelo está para classificar corretamente um resultado positivo (TP).

![image.png](data:image/png;base64,)

A última métrica que eu apresento a você é o recall. O recall também é conhecido como revocação ou sensibilidade. Preste muita atenção, o recall muitas vezes é confundido com a precisão, porque ele vai medir quão bom o nosso modelo está em classificar os resultados realmente positivos.

Vamos ver a fórmula do recall. Verdadeiros positivos, que são aqueles que foram classificados como sim pelo nosso modelo e que são realmente sim, divididos pelos verdadeiros positivos mais os falsos negativos, "RC = TP/TP + FN". Entendeu a diferença?

Aqui, os falsos negativos não deveriam ser positivos? Por isso que essa métrica é considerada aquela que calcula realmente quais os resultados verdadeiramente positivos. Vamos aplicar no nosso modelo e ver qual o resultado disso.
"""

from sklearn.metrics import recall_score

#modelo KNN
print(recall_score(y_teste, predito_knn))

#modelo Bernoulli de naive bayes
print(recall_score(y_teste, predito_BNb))

#modelo árvore de decisão
print(recall_score(y_teste, predito_ArvoreDecisao))

"""# Escolhendo o melhor modelo"""

#Exemplo - análise das precisões calculadas anteriormente
print('Modelo KNN: ', precision_score(y_teste, predito_knn))
print('Modelo Bernoulli de Naive Bayes: ', precision_score(y_teste, predito_BNb))
print('Modelo Árvore de Decisão: ', precision_score(y_teste, predito_ArvoreDecisao))

